import easyinvoice, { InvoiceData } from "easyinvoice";
import logo from "../assets/images/logo.jpg";
import background from "../assets/images/background.jpg";

async function generateReceipt(
  studentName: string,
  studentClass: string,
  feeType: string,
  fee: number,
  email: string,
  invoiceNumber: string
) {
  console.log(studentName, studentClass, feeType, fee, email, invoiceNumber);

  const invoiceData: InvoiceData = {
    images: {
      logo: "", // URL of your logo
      background: "",
    },
    sender: {
      company: "Lajfort Schools",
      address: "Plot 9, Lajfort Avenue",
      zip: "202111",
      city: "Abule Isale",
      country: "Iju-Ota, Ogun state",
    },
    client: {
      company: `${studentName} - ${studentClass}`, // Student's name
      address: email,
      zip: "Iju-Ota",
      city: "Ogun state",
      country: "Nigeria",
      //   company: "Client Corp",
      //   address: "Clientstreet 456",
      //   zip: "4567 CD",
      //   city: "Clientcity",
      //   country: "Clientcountry",
    },
    information: {
      number: invoiceNumber,
      date: new Date().toLocaleDateString(),
    },
    products: [
      {
        quantity: "1",
        description: feeType,
        "tax-rate": 0,
        price: fee, // Fee amount
      },
    ],
    "bottom-notice": "Ensure to bring a copy of this invoice upon resumption.",
    settings: {
      currency: "NGN",
    },
  };

  const result = await easyinvoice.createInvoice(invoiceData);

  easyinvoice.download(
    `Receipt-${studentName}-${studentClass}.pdf`,
    result.pdf
  );
}

export default generateReceipt;
